import React from "react";
import Banner from "./Banner";
import Header from "./Header";
import CovidAdd from "./CovidAdd";
import MidSection from "./MidSection";
import WhatWeDo from "./WhatWeDo";

function Home() {
  return (
    <div>
      <Header />
      <CovidAdd />
      <Banner />
      <MidSection />
      <div className="whatwedo__container">
        <WhatWeDo
          path={require("./Images/management.jpg").default}
          title="Management"
          text="Lorem ipsum dolor sit amet consectetur adipisicing"
          link="Learn more"
        />
        <WhatWeDo
          path="./Images/maintanance.jpg"
          title="Maintanance"
          text="Lorem ipsum dolor sit amet consectetur adipisicing"
          link="Learn more"
        />
        <WhatWeDo
          path="./Images/consultation.jpg"
          title="Consultation"
          text="Lorem ipsum dolor sit amet consectetur adipisicing"
          link="Learn more"
        />
      </div>
    </div>
  );
}

export default Home;
